package fossil

import "testing"

type problemBTestCase struct {
	input  string
	expect string
}

var problemBTestCases = []problemBTestCase{
	{"ABA", "ABC"},
	{"BBBBBB", "AABBCC"},
	{"BCB", "ACB"},
	{"AAB", "ACB"},
	{"ACC", "ABC"},
	{"BCC", "BAC"},
	{"CCBCBB", "ACACBB"},
	{"CBBCAA", "CBBCAA"},
	{"BCABBA", "BCABCA"},
	{"AAABBB", "AACBBC"},
	{"AAAAAAAAACCCCCC", "AAAAABBBBBCCCCC"},
	{
		input:  "BCCCACABBACBACAACBBBABBABABCCBCCBAABCCBABABABBBACCBCBCBBCCBB",
		expect: "ACCCACAAAACAACAACABBABBABABCCBCCBAABCCBABABABBBACCBCBCBBCCBC",
	},
	{
		input:  "AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACCC",
		expect: "AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAABBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBBCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCCC",
	},
	{
		input:  "",
		expect: "",
	},
}

func TestProblemB(t *testing.T) {
	for index, testcase := range problemBTestCases {
		output := ProblemB(testcase.input)
		if output != testcase.expect {
			t.Errorf("Case %d failed: want %s but return %s", index, testcase.expect, output)
		}
	}
}
